/*      Abstract: The custom MKAnnotation object representing a venue.  */#import "Venue1Annotation.h"@implementation Venue1Annotation@synthesize latitude;@synthesize longitude;- (CLLocationCoordinate2D)coordinate;{    CLLocationCoordinate2D theCoordinate;    theCoordinate.latitude = 40.748368;    theCoordinate.longitude = -73.984627;    return theCoordinate; }- (NSString *)title{    return @"Empire State Building";}// optional- (NSString *)subtitle{    return @"Capable of 16 million different color combos";}@end
